(1, '43315894', 'What is the answer of life and death', 'Why are we still here? Just to suffer? Every night, I can feel my leg… and my arm… even my fingers. The body I’ve lost… the comrades I’ve lost… won’t stop hurting… It’s like they’re all still there. You feel it, too, don’t you? ', '2018-04-16 06:32:20'),
