INSERT INTO `job` (`Job_id`, `Job_name`, `Job_info`, `Start_date`, `End_date`, `Create_time`, `Company`, `Email`, `Phone`, `User_id`, `Job_cat_id`, `Job_description`, `status`) VALUES
(1, 'Content Creator', 'Ready to start your career as a creator? Join us now!', '2018-04-02', '2018-04-27', '2018-04-29 16:07:28', 'Blogger Corporation', 'job@blogger.co', '21234567', '0a26cd8d1f5b4b8097efb90b48740347', 2, 'programming.collective.intelligence.aug.2007', 1),
(2, 'Supply Manager', 'Ready to start your career as a creator? Join us now!', '2018-04-02', '2018-04-27', '2018-04-29 16:07:32', 'Blogger Corporation', 'job@blogger.co', '21234567', '0a26cd8d1f5b4b8097efb90b48740347', 1, 'programming.collective.intelligence.aug.2007', 1),
(3, 'Market Manager', 'Responsibilities: As Market Manager, your key objective will be to help expand Agoda’s room supply network and establish and manage hotel relationships.  Ideally you should be experienced in the hotel industry and / or travel industry, especially online travel.', '2018-04-22', '2018-04-27', '2018-04-29 16:07:19', 'Agoda Services Co., Ltd', 'campus@agoda.com', '0234566781', '36a83c28b8764126bfe7a7ab9bf68095', 1, 'MSSQLServer2017_Installation_Guide_v2.pdf', 1),
(4, 'Market Manager', 'As Market Manager, your key objective will be to help expand Agoda’s room supply network and establish and manage hotel relationships.  Ideally you should be experienced in the hotel industry and / or travel industry, especially online travel.  You will be taking care of the hotel market and assisting market partnership related functions, as well as identifying trends and defining potential sources of supply to satisfy consumer demand on the Agoda website.', '2018-04-21', '2018-04-27', '2018-04-29 16:07:00', 'Agoda', 'a@agoda.com', '0892221222', '36a83c28b8764126bfe7a7ab9bf68095', 1, 'MSSQLServer2017_Installation_Guide_v2.pdf', 1),
(5, 'asdasd', 'asdasd', '2018-04-19', '2018-04-20', '2018-04-29 16:06:55', 'Dog', 'adas@.', '2222222222', '36a83c28b8764126bfe7a7ab9bf68095', 7, 'Time_Management-2.pdf', 0),
(6, 'Consultant', 'Full time position and intern opportunities as a consultant for Korn Ferry.', '2018-04-29', '2018-05-05', '2018-04-30 05:33:07', 'Korn Ferry', 'hr@kornferry.com', '0123456789', '0a26cd8d1f5b4b8097efb90b48740347', 6, 'job-example2.jpg', 1),
(7, 'Functional Tester', 'Minimum 2 years experiences in Functional Testing\r\n• Knowledge in business process design\r\n• Banking domain testing is a plus\r\n• Thai speaker with good English communication', '2018-04-29', '2018-05-05', '2018-04-29 16:03:35', 'Asian Technology Solutions', 'hr@ats.com', '0123456789', '0a26cd8d1f5b4b8097efb90b48740347', 6, 'job-example.pdf', 1);
