('0a26cd8d1f5b4b8097efb90b48740347', '<p>My name is Nattapol Choojirawong but you can call me &quot;Meant&quot;. I&#39;m a senior student in Information Communication Engineering from Chulalongkorn University.</p><p>I teach individually and in group (at most 4)</p><ol><li>&nbsp;For individually, the price is the same as list on the page.</li><li>For group,<ol><li>Python Programming - 500 per person</li><li>Object Oriented Programming - 650 per person</li></ol></li></ol><p>If you&#39;re interested, teach contact me via Line ID or Facebook</p>', 'https://www.youtube.com/embed/dQw4w9WgXcQ', 'Nattapol Choojirawong', 'nattapolchoo', '0909701697', '2018-04-21 22:58:56'),
